INSERT INTO `block_custom` VALUES (1,'<h2>Featured</h2>\r\n  \r\n<div class=\"row\">\r\n\r\n<div class=\"col-md-4\">\r\n<div class=\"post-thumb-wrap-center\">\r\n<div class=\"post-thumb-wrap\">\r\n<img width=\"300\" height=\"300\" src=\"<?php print base_path() . drupal_get_path(\'theme\', \'sunrise\') ;?>/images/local/nightlife-q-c-1107-1019-2-300x300.jpg\">\r\n</div>\r\n</div>\r\n<h3 class=\"post-title\"><a href=\"?q=node/17\">Vivamus sed vestibulum tortor</a><br></h3>\r\n<div class=\"post-content\">\r\n<p>Donec vel sem condimentum, interdum lacus nec, vulputate ante. Curabitur vulputate quis elit sit amet<br>\r\n<a class=\"post_read_more\" href=\"?q=node/17\">Read More</a>\r\n</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<div class=\"post-thumb-wrap-center\">\r\n<div class=\"post-thumb-wrap\">\r\n<img width=\"300\" height=\"300\" src=\"<?php print base_path() . drupal_get_path(\'theme\', \'sunrise\') ;?>/images/local/nightlife-q-c-1107-1019-6-300x300.jpg\">\r\n</div>\r\n</div>\r\n<h3 class=\"post-title\"><a href=\"?q=node/15\">Quisque at tristique metus</a><br></h3>\r\n<div class=\"post-content\">\r\n<p>Suspendisse placerat justo non ante condimentum, eu feugiat dolor luctus. Aliquam cursus lorem mi, ac<a class=\"post_read_more\" href=\"?q=node/15\">Read More</a></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<div class=\"post-thumb-wrap-center\">\r\n<div class=\"post-thumb-wrap\">\r\n<img width=\"300\" height=\"300\" src=\"<?php print base_path() . drupal_get_path(\'theme\', \'sunrise\') ;?>/images/local/nightlife-q-c-1105-793-1-300x300.jpg\">\r\n</div>\r\n</div>\r\n<h3 class=\"post-title\"><a href=\"?q=node/16\">Maecenas congue ipsum lorem</a><br></h3>\r\n<div class=\"post-content\">\r\n<p>Aenean feugiat justo risus, vitae cursus leo ultrices sit amet. Integer non felis imperdiet, blandit<a class=\"post_read_more\" href=\"?q=node/16\">Read More</a></p>\r\n</div>\r\n</div>\r\n\r\n</div>','Promoted','php_code'),(2,' <div class=\"row\">\r\