Steve Job’ needed for a salary.</td></tr><tr class=\"even\"><td><a href=\"#\" rel=\"nofollow\">Tom McFarlin</a></td><td>$100K</td><td>For all the blogging he does.</td></tr><tr class=\"odd\"><td><a href=\"#\" rel=\"nofollow\">Jared Erickson</a></td><td>$100M</td><td>Pictures are worth a thousand words, right? So Tom x 1,000.</td></tr><tr class=\"even\"><td><a href=\"#\" rel=\"nofollow\">Chris Ames</a></td><td>$100B</td><td>With hair like that?! Enough said…</td></tr></tbody></table>','full_html'),('comment','comment_node_article',0,11,11,'und',0,'<h3>Ordered List</h3>\r\n<ol><li>This is a sample <strong>Ordered List</strong>.</li>\r\n<li>Lorem ipsum dolor sit amet consectetuer.</li>\r\n<li>Condimentum quis.</li>\r\n<li>Congue Quisque augue elit dolor.\r\n<ol><li>Something goes here.</li>\r\n<li>And another here</li>\r\n<li>Then one more</li>\r\n</ol></li>\r\n<li>Congue Quisque augue elit dolor nibh.</li>\r\n</ol><h3>Unordered List</h3>\r\n<ul><li>This is a sample <strong>Unordered List</strong>.</li>\r\n<li>Condimentum quis.</li>\r\n<li>Congue Quisque augue elit dolor.\r\n<ul><li>Something goes here.</li>\r\n<li>And another here\r\n<ul><li>Something here as well</li>\r\n<li>Something here as well</li>\r\n<li>Something here as well</li>\r\n</ul></li>\r\n<li>Then one more</li>\r\n</ul></li>\r\n<li>Nunc cursus sem et pretium sapien eget.</li>\r\n</ul><h3>Fieldset</h3>\r\n<p></p><fieldset><legend>Account information</legend> </fieldset>\r\n<h3>Definition List</h3>\r\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher “Big Black” Boykins, “Do Work” works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I’ll let Bill O’Reilly will <a title=\"We\'ll Do It Live\" href=\"#\" rel=\"nofollow\">explain</a> this one.</dd></dl>\r\n<h3>HTML Tags</h3>\r\n<p><strong>Address Tag</strong></p>\r\n<address>1 Infinite Loop<br> Cupertino, CA 95014<br> United States</address>\r\n<p><strong>Anchor Tag (aka. Link)</strong></p>\r\n<p>This is an example of a <a title=\"Apple\" href=\"http://apple.com\" rel=\"nofollow\">link</a>.</p>\r\n<p><strong>Abbreviation Tag</strong></p>\r\n<p>The abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for “seriously”.</p>\r\n<p><strong>Acronym Tag</strong></p>\r\n<p>The acronym <acronym title=\"For The Win\">ftw</acronym> stands for “for the win”.</p>\r\n<p><strong>Big Tag</strong></p>\r\n<p>These tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.</p>\r\n<p><strong>Cite Tag</strong></p>\r\n<p>“Code is poetry.” –<cite>Automattic</cite></p>\r\n<p><strong>Code Tag</strong></p>\r\n<p>You will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.</p>\r\n<p><strong>Delete Tag</strong></p>\r\n<p>This tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).</p>\r\n<p><strong>Emphasize Tag</strong></p>\r\n<p>The emphasize tag should <em>italicize</em> text.</p>\r\n<p><strong>Insert Tag</strong></p>\r\n<p>This tag should denote <ins>inserted</ins> text.</p>\r\n<p><strong>Keyboard Tag</strong></p>\r\n<p>This scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.</p>\r\n<p><strong>Preformatted Tag</strong></p>\r\n<p>This tag styles large blocks of code.</p>\r\n<pre>.post-title {\r\n  margin: 0 0 5px;\r\n  font-weight: bold;\r\n  font-size: 38px;\r\n  line-height: 1.2;\r\n}</pre>\r\n<p><strong>Quote Tag</strong></p>\r\n<p><q>Developers, developers, developers…</q> –Steve Ballmer</p>\r\n<p><strong>Strong Tag</strong></p>\r\n<p>This tag shows <strong>bold</strong><strong> text.</strong></p>\r\n<p><strong>Subscript Tag</strong></p>\r\n<p>Getting our science styling on with H<sub>2</sub>O, which should push the “2″ down.</p>\r\n<p><strong>Superscript Tag</strong></p>\r\n<p>Still sticking with science and Isaac Newton’s E = MC<sup>2</sup>, which should lift the 2 up.</p>\r\n<p><strong>Teletype Tag</strong></p>\r\n<p>This rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.</p>\r\n<p><strong>Variable Tag</strong></p>\r\n<p>This allows you to denote <var>variables</var>.</p>','full_html'),('comment','comment_node_blog',0,12,12,'und',0,'Duis non quam vitae leo consequat suscipit. Proin tincidunt rhoncus libero nec aliquam. Pellentesque ac posuere sapien. In vehicula orci vel turpis venenatis faucibus. Sed malesuada sollicitudin enim et hendrerit. Curabitur neque nisi, tristique vel iaculis placerat, laoreet id diam. Ut condimentum fringilla quam, non varius dui tincidunt ac.','filtered_html'),('comment','comment_node_blog',0,13,13,'und',0,'Donec fringilla rutrum mauris quis sagittis. Quisque lorem tortor, molestie eu libero vel, fringilla tempor augue.','filtered_html'),('comment','comment_node_blog',0,14,14,'und',0,'Fusce tristique molestie sapien, gravida malesuada odio eleifend in. Fusce vehicula sem ac posuere suscipit. Suspendisse nisi tellus, porta vitae molestie nec, mattis ut velit.','filtered_html'),('comment','comment_node_blog',0,15,15,'und',0,'Donec ac posuere est, in interdum nisi. Sed aliquam, erat sed sagittis venenatis, nulla neque adipiscing eros, id hendrerit augue orci pellentesque erat. Phasellus pellentesque, dolor vitae elementum malesuada, quam eros ornare arcu, at faucibus est arcu non eros. Cras tincidunt ligula felis, non posuere magna accumsan at. Fusce tristique molestie sapien, gravida malesuada odio eleifend in. Fusce vehicula sem ac posuere suscipit. Suspendisse nisi tellus, porta vitae molestie nec, mattis ut velit.','filtered_html'),('comment','comment_node_blog',0,16,16,'und',0,'Nunc tincidunt nec leo at lacinia. Ut